import Layout from "../components/Layout";
import * as S from "../components/Typography";

export default function Index() {
    return (
       <Layout>
           <S.Label>Justin White</S.Label>
           <S.Title>
               Digital designer with prior background in data analysis.
                Creating for the web and mobile.
           </S.Title>
       </Layout>
    );
}
